import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import SearchBar from './SearchBar';
import FilterDropDowns from './FilterDropDowns';
import {options} from '../Utils/DropDownOprions';
import ListGroup from 'react-bootstrap/ListGroup';
import UseFiltersToggle from './UseFiltersToggle';
import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";

class FilterNavBar extends React.Component {


  constructor(props) {
    super(props);
    this.dropDownOptions=options;
  }

    render() {

      this.filterDropDownsComponent=this.dropDownOptions.map((details)=>(
            <FilterDropDowns details={details}/>
      ))

        return(
          <>
          <nav class="navbar navbar-dark fixed-top navbar-expand-sm ">
      <Container>
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#Navbar">
              <span class="navbar-toggler-icon"></span>
          </button>
          <a href="#" class="navbar-brand "><img src="img/logo.jpeg" height="30" width="31"/></a>
          <div class="collapse navbar-collapse" id="Navbar">
              <ul class="navbar-nav ml-auto">
                  <li class="nav-item"><a class="nav-link active" href="#"><span class="fa fa-home fa-lg"></span> Dashboard</a></li>
